import React from "react";

export default function Goods(props) {
  const { id, name, description, image,full_background,price} = props;
  return (
    <>
      <>
        <div className="card hoverable"  id={id}>
          <div
            className="card-image "
            style={{ width: "100%", height: "300px" }}
          >
            <img
              className="responsive-img"
              style={{
                width: '100%',
                height: "100%",
                padding: "0",
                boxSizing: "border-box",
              }}
              src={
                full_background ? full_background : "https://media.fortniteapi.io/images/displayAssets/v2/CID_A_195_M_Crisis.png"
              }
              alt="shop"
            />
            <a
              href="#!"
              className="btn-floating halfway-fab waves-effect waves-light red"
            >
              <i className="material-icons">add</i>
            </a>
          </div>
          <div className="card-content">
            <span>{name}</span>
            <p>
             {description}
            </p>
          </div>
          <div className="card-action valign-wrapper">
              <span className="purple-text text-darken-2">{price}$</span>
              <button className="btn blue darken-4 hoverable">buy</button>
          </div>  
        </div>
      </>
    </>
  );
}
